    return (
        <nav className="nav"> 
        <a href= "/" className= "SiteTitle"> Tatos</a>
        <ul>
            <li>
                <a href= "/Game"> Game </a>
            </li>
            <li>
                <a href= "/credits"> Credits </a>
            </li>
        </ul>
        </nav>
    );
}
